import './App.css';
import data from './data';
import Display from './Display';

function App() {

  function printConsole() {
    data.forEach(function (item) {
      console.log(item.name, item.price, item.pictures, item.seller, item.location, item.rate);
    })
  };


  return (
    <div className="App">



        <div>
          <Display name={data[0].name}
            price={data[0].price}
            pictures={data[0].pictures}
            seller={data[0].seller}
            location={data[0].location}
            rate={data[0].rate}
          />
        </div>



    </div>
  );
}

export default App;
